import React, { Component } from 'react';
import s from './Leagues.module.css';
import  League  from './League/League';
import  leaguesData1  from '../../data/league';

const TITLE = 'Список лиг';

let LeaguesData = [
{league_id:1, league_name:'League1'},
{league_id:2, league_name:'League2'},
{league_id:3, league_name:'League3'},]

const ListLeagues=LeaguesData.map(item => ( 
               < League league_id={item.league_id} league_name={item.league_name}/> ));

const Leagues = (props) => {
  
	return( <div >
            <h1>{ TITLE }</h1>
            <h2>{ props.period }</h2>
            <div className={s.list_items}>         
               {ListLeagues }
            </div>
        </div>
  )//return      
}

export default Leagues;
